INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (2, "ヒヨリ", 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 0, "A", 27, 16, "東山奈央", 44, 100101, 155, "トゥインクルウィッシュ", "人助けが大好き！　前向き格闘娘", "獣人族", "人助け、応援");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (2, "ユイ", 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 0, "O", 5, 17, "種田梨沙", 47, 100201, 158, "トゥインクルウィッシュ", "戦闘のサポートが得意な、心優しい少女", "ヒューマン", "料理、人間観察");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (2, "レイ", 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 0, "B", 12, 18, "早見沙織", 46, 100301, 163, "トゥインクルウィッシュ", "クールで何事にも真っ直ぐな剣士", "魔族", "読書、乗馬、お茶");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (5, "ミソギ", 8, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 0, "O", 10, 9, "諸星すみれ", 27, 100401, 128, "リトルリリカル", "探検好きのイタズラっ子", "ヒューマン", "いたずら、探検");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (8, "マツリ", 11, "？？？", 0, "O", 25, 12, "下田麻美", 40, 100501, 146, "王宮騎士団（NIGHTMARE）", "ヒーローに憧れる騎士見習いの少女", "獣人族", "ヒーローごっこ");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (7, "アカリ", 11, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 0, "O", 22, 13, "浅倉杏美", 42, 100601, 150, "悪魔偽王国軍（ディアボロス）", "甘え上手なみんなの人気者", "魔族", "サックス");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (7, "ミヤコ", 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 0, "B", 23, 14, "雨宮天", 32, 100701, 130, "悪魔偽王国軍（ディアボロス）", "プリン大好きゴースト娘", "魔族", "プリンを食べること");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (15, "ユキ", 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 0, "AB", 10, 14, "大空直美", 40, 100801, 150, "ヴァイスフリューゲル　ランドソル支部", "ボクは誰よりも美しい", "エルフ", "鏡で自分を見ること");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (13, "アンナ", 7, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 0, "A", 5, 17, "髙野麻美", 45, 100901, 159, "トワイライトキャラバン", "前世を信じる中二病患者、「疾風の冥姫」", "魔族", "小説執筆");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (10, "マホ", 9, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 0, "O", 22, 16, "内田真礼", 42, 101001, 155, "自警団（カォン）", "マホマホ王国のプリンセス", "獣人族", "空想、ぬいぐるみ集め");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (3, "リノ", 8, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 0, "A", 25, 15, "阿澄佳奈", 44, 101101, 156, "ラビリンス", "人懐っこくてマシンガントークな妹系少女", "ヒューマン", "お裁縫");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (6, "ハツネ", 12, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 0, "A", 24, 17, "大橋彩香", 46, 101201, 156, "フォレスティエ", "みんなのために超能力を使う眠り姫", "エルフ", "妹と遊ぶこと、二度寝、昼寝、早寝");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (13, "ナナカ", 8, "", 0, "O", 21, 18, "佳村はるか", 55, 101301, 166, "トワイライトキャラバン", "オタク全開な魔法少女", "魔族", "読書、魔法");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (10, "カスミ", 11, "test", 0, "AB", 3, 15, "水瀬いのり", 41, 101401, 152, "自警団（カォン）", "頭脳明晰な美少女名探偵", "獣人族", "読書、推理");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (6, "ミサト", 9, "test", 0, "O", 5, 21, "國府田マリ子", 54, 101501, 165, "フォレスティエ", "母性溢れる優しいみんなの「ミサト先生」", "エルフ", "絵本作り");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (14, "スズナ", 4, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 0, "O", 10, 17, "上坂すみれ", 48, 101601, 167, "ルーセント学院", "天真爛漫で人気者のカリスマモデル", "魔族", "ファッション");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (10, "カオリ", 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 0, "A", 7, 17, "高森奈津美", 53, 101701, 158, "自警団（カォン）", "いつでも「なんくるないさ～」な天然娘", "獣人族", "踊り、空手");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (14, "イオ", 8, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 0, "B", 14, 23, "伊藤静", 52, 101801, 162, "ルーセント学院", "多くの男性を魅了する無垢な女教師", "魔族", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (5, "ミミ", 4, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 0, "O", 3, 10, "日高里菜", 21, 102001, 117, "リトルリリカル", "お歌もにんじんも、ウサギさんも大好き♪", "獣人族", "かわいいもの集め");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (9, "クルミ", 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 0, "B", 9, 12, "植田佳奈", 40, 102101, 150, "サレンディア救護院", "泣き虫で臆病な守ってあげたい女の子", "ヒューマン", "観劇、おままごと");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (7, "ヨリ", 11, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 0, "O", 22, 13, "原紗友里", 40, 102201, 150, "悪魔偽王国軍（ディアボロス）", "人見知りであまのじゃくな女の子", "魔族", "ゲーム全般");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (9, "アヤネ", 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 0, "B", 10, 14, "芹澤優", 38, 102301, 148, "サレンディア救護院", "ぷうきちといつも一緒！", "ヒューマン", "屋内でできる遊び");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (9, "スズメ", 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 0, "O", 12, 15, "悠木碧", 43, 102501, 154, "サレンディア救護院", "お嬢さまのためにがんばるドジっ娘メイド", "ヒューマン", "ご奉仕");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (11, "リン", 1, "test", 0, "B", 1, 17, "小岩井ことり", 42, 102601, 144, "牧場（エリザベスパーク）", "遊びと睡眠が何より大事なぐうたら娘", "獣人族", "あんパン");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (13, "エリコ", 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 0, "B", 30, 16, "橋本ちなみ", 43, 102701, 154, "トワイライトキャラバン", "運命の相手に一途すぎる乙女", "魔族", "実験、裁縫、料理");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (9, "サレン", 10, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 0, "A", 4, 17, "堀江由衣", 43, 102801, 156, "サレンディア救護院", "救護院を経営する優しい庶民派お嬢様", "エルフ", "経営、お茶会");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (4, "ノゾミ", 1, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 0, "B", 24, 17, "日笠陽子", 40, 102901, 157, "カルミナ", "歌って踊れる大人気アイドル", "ヒューマン", "舞台鑑賞、ダンス");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (15, "ニノン", 8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 0, "O", 31, 16, "佐藤聡美", 51, 103001, 163, "ヴァイスフリューゲル　ランドソル支部", "トーゴクの神秘、オシエテクダサイ！", "ヒューマン", "忍法開発");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (7, "シノブ", 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 0, "AB", 22, 18, "大坪由佳", 42, 103101, 157, "悪魔偽王国軍（ディアボロス）", "占いが得意な霊能少女", "魔族", "占い");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (12, "アキノ", 3, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 0, "AB", 12, 18, "松嵜麗", 45, 103201, 157, "メルクリウス財団", "一人前の商人を目指すパワフルお嬢様", "ヒューマン", "慈善事業");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (11, "マヒル", 3, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 0, "B", 3, 20, "新田恵海", 35, 103301, 142, "牧場（エリザベスパーク）", "みんなを笑顔にするお笑い牧場主", "ヒューマン", "漫才");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (12, "ユカリ", 3, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 0, "A", 16, 22, "今井麻美", 55, 103401, 164, "メルクリウス財団", "純情でほっとけない大人の女性", "エルフ", "ウインドーショッピング");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (5, "キョウカ", 2, "test", 0, "A", 2, 8, "小倉唯", 21, 103601, 118, "リトルリリカル", "礼儀正しくしっかり者のちびっ子優等生", "エルフ", "お勉強");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (8, "トモ", 8, "test", 0, "A", 11, 13, "茅原実里", 43, 103701, 149, "王宮騎士団（NIGHTMARE）", "義理堅くてからかい好きな剣術少女", "ヒューマン", "剣術、年長者をからかう");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (11, "シオリ", 11, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 0, "A", 3, 14, "小清水亜美", 40, 103801, 153, "牧場（エリザベスパーク）", "読書が趣味の病弱少女", "獣人族", "読書、お散歩");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (6, "アオイ", 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 0, "AB", 6, 13, "花澤香菜", 44, 104001, 158, "フォレスティエ", "「友達」に憧れる、エルフの森の女の子", "エルフ", "友達作りのイメトレ");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (4, "チカ", 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 0, "O", 3, 17, "福原綾香", 46, 104201, 163, "カルミナ", "人々を守るために歌う、唱喚士の少女", "ヒューマン", "各種楽器");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (10, "マコト", 8, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 0, "O", 9, 17, "小松未可子", 54, 104301, 168, "自警団（カォン）", "男勝りで情に厚いワイルド娘", "獣人族", "お菓子作り");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (7, "イリヤ", 5, "test", 0, "A", 5, "??", "丹下桜", 50, 104401, 172, "悪魔偽王国軍（ディアボロス）", "かつては夜を支配した最強の吸血鬼", "魔族", "世界征服");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (15, "クウカ", 11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 0, "AB", 19, 18, "長妻樹里", 49, 104501, 157, "ヴァイスフリューゲル　ランドソル支部", "妄想大好き！　ほんとは照れ屋な女の子", "ヒューマン", "小説を読むこと");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (12, "タマキ", 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 0, "AB", 1, 19, "沼倉愛美", 48, 104601, 158, "メルクリウス財団", "弱きを助け強きをくじく猫娘", "獣人族", "猫とたわむれること");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (8, "ジュン", 10, "？？？", 0, "A", 25, 25, "川澄綾子", 50, 104701, 171, "王宮騎士団（NIGHTMARE）", "素顔を見せない冷静沈着な女性騎士", "ヒューマン", "格闘技、湯浴み");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (12, "ミフユ", 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 0, "O", 11, 20, "田所あずさ", 49, 104801, 163, "メルクリウス財団", "仕事も私事も効率優先な傭兵少女", "ヒューマン", "傭兵などのアルバイト");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (3, "シズル", 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 0, "O", 24, 18, "生天目仁美", 54, 104901, 168, "ラビリンス", "お姉ちゃんがお世話してあげるからねっ！", "ヒューマン", "家事全般");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (14, "ミサキ", 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 0, "A", 3, 11, "久野美咲", 22, 105001, 120, "ルーセント学院", "ちょっとおませな恋に恋する女の子", "魔族", "ファッション誌鑑賞、コスメ集め");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (13, "ミツキ", 3, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 0, "A", 7, 27, "三石琴乃", 53, 105101, 166, "トワイライトキャラバン", "実験が趣味の危険な科学者", "ヒューマン", "研究、実験");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (11, "リマ", 3, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 0, "A", 14, 17, "徳井青空", 100, 105201, 150, "牧場（エリザベスパーク）", "乙女チックなもふもふアニマル", "獣人族", "毛繕い、お喋り");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (15, "モニカ", 7, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 0, "A", 28, 17, "辻あゆみ", 33, 105301, 140, "ヴァイスフリューゲル　ランドソル支部", "見た目も中身もお子ちゃまな異国の軍人", "ヒューマン", "お菓子屋通い");
