INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES ("", "ジータ", 3, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", 0, "O", 10, 17, "金元寿子", 45, 105701, 156, "？？？", "空への冒険を夢見る騎空士の少女", "ヒューマン", "冒険、おしゃべり");
