INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (12, "タマキ（サマー）", 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 0, "AB", 1, 19, "沼倉愛美", 48, 107901, 158, "メルクリウス財団", "弱きを助け強きをくじく猫娘", "獣人族", "猫とたわむれること");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (12, "ミフユ（サマー）", 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 0, "O", 11, 20, "田所あずさ", 49, 108001, 163, "メルクリウス財団", "仕事も私事も効率優先な傭兵少女", "ヒューマン", "傭兵などのアルバイト");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (7, "シノブ（ハロウィン）", 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 0, "AB", 22, 18, "大坪由佳", 42, 108101, 157, "悪魔偽王国軍（ディアボロス）", "占いが得意な霊能少女", "魔族", "占い");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (7, "ミヤコ（ハロウィン）", 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 0, "B", 23, 14, "雨宮天", 32, 108201, 130, "悪魔偽王国軍（ディアボロス）", "プリン大好きゴースト娘", "魔族", "プリンを食べること");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (14, "ミサキ（ハロウィン）", 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 0, "A", 3, 11, "久野美咲", 22, 108301, 120, "ルーセント学院", "ちょっとおませな恋に恋する女の子", "魔族", "ファッション誌鑑賞、コスメ集め");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (4, "チカ（クリスマス）", 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 0, "O", 3, 17, "福原綾香", 46, 108401, 163, "カルミナ", "人々を守るために歌う、唱喚士の少女", "ヒューマン", "各種楽器");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (9, "クルミ（クリスマス）", 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 0, "B", 9, 12, "植田佳奈", 40, 108501, 150, "サレンディア救護院", "泣き虫で臆病な守ってあげたい女の子", "ヒューマン", "観劇、おままごと");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (9, "アヤネ（クリスマス）", 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 0, "B", 10, 14, "芹澤優", 38, 108601, 148, "サレンディア救護院", "ぷうきちといつも一緒！", "ヒューマン", "屋内でできる遊び");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (2, "ヒヨリ（ニューイヤー）", 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 0, "A", 27, 16, "東山奈央", 44, 108701, 155, "トゥインクルウィッシュ", "人助けが大好き！　前向き格闘娘", "獣人族", "人助け、応援");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (2, "ユイ（ニューイヤー）", 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 0, "O", 5, 17, "種田梨沙", 47, 108801, 158, "トゥインクルウィッシュ", "戦闘のサポートが得意な、心優しい少女", "ヒューマン", "料理、人間観察");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (2, "レイ（ニューイヤー）", 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 0, "B", 12, 18, "早見沙織", 46, 108901, 163, "トゥインクルウィッシュ", "クールで何事にも真っ直ぐな剣士", "魔族", "読書、乗馬、お茶");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (13, "エリコ（バレンタイン）", 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 0, "B", 30, 16, "橋本ちなみ", 43, 109001, 154, "トワイライトキャラバン", "運命の相手に一途すぎる乙女", "魔族", "実験、裁縫、料理");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (3, "シズル（バレンタイン）", 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 0, "O", 24, 18, "生天目仁美", 54, 109101, 168, "ラビリンス", "お姉ちゃんがお世話してあげるからねっ！", "ヒューマン", "家事全般");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES ("", "アン", 12, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 0, "AB", 1, 17, "日笠陽子", 55, 109201, 156, "？？？", "英霊と契約を結んだマナリアの天才王女", "ヒューマン", "読書");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES ("", "ルゥ", 2, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 0, "O", 4, 16, "こやまきみこ", 45, 109301, 144, "？？？", "マナリア魔法学院の新入生", "ヒューマン", "食べること、眠ること");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES ("", "グレア", 11, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 0, "B", 3, 17, "福原綾香", 67, 109401, 167, "？？？", "人を超越した力を有す心優しい竜姫", "半人半竜", "ピアノ");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (15, "クウカ（オーエド）", 11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 0, "AB", 19, 18, "長妻樹里", 49, 109501, 157, "ヴァイスフリューゲル　ランドソル支部", "妄想大好き！　ほんとは照れ屋な女の子", "ヒューマン", "小説を読むこと");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (15, "ニノン（オーエド）", 8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 0, "O", 31, 16, "佐藤聡美", 51, 109601, 163, "ヴァイスフリューゲル　ランドソル支部", "トーゴクの神秘、オシエテクダサイ！", "ヒューマン", "忍法開発");
