INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (13, "アンナ（サマー）", 7, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 0, "A", 5, 17, "髙野麻美", 45, 113201, 159, "トワイライトキャラバン", "前世を信じる中二病患者、「疾風の冥姫」", "魔族", "小説執筆");
