INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (10, "マホ（シンデレラ）", 9, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 0, "O", 22, 16, "内田真礼", 42, 116001, 155, "自警団（カォン）", "マホマホ王国のプリンセス", "獣人族", "空想、ぬいぐるみ集め");
