INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (12, "タマキ（作業服）", 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 0, "AB", 1, 19, "沼倉愛美", 48, 116801, 158, "メルクリウス財団", "弱きを助け強きをくじく猫娘", "獣人族", "猫とたわむれること");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (12, "ミフユ（作業服）", 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 0, "O", 11, 20, "田所あずさ", 49, 116901, 163, "メルクリウス財団", "仕事も私事も効率優先な傭兵少女", "ヒューマン", "傭兵などのアルバイト");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (13, "エリコ（サマー）", 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 0, "B", 30, 16, "橋本ちなみ", 43, 117001, 154, "トワイライトキャラバン", "運命の相手に一途すぎる乙女", "魔族", "実験、裁縫、料理");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (3, "シズル（サマー）", 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 0, "O", 24, 18, "生天目仁美", 54, 117101, 168, "ラビリンス", "お姉ちゃんがお世話してあげるからねっ！", "ヒューマン", "家事全般");
