INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (4, "チカ（サマー）", 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 0, "O", 3, 17, "福原綾香", 46, 117301, 163, "カルミナ", "人々を守るために歌う、唱喚士の少女", "ヒューマン", "各種楽器");
