INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (13, "ミツキ（オーエド）", 3, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 0, "A", 7, 27, "三石琴乃", 53, 117501, 166, "トワイライトキャラバン", "実験が趣味の危険な科学者", "ヒューマン", "研究、実験");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (15, "ユキ（オーエド）", 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 0, "AB", 10, 14, "大空直美", 40, 117601, 150, "ヴァイスフリューゲル　ランドソル支部", "ボクは誰よりも美しい", "エルフ", "鏡で自分を見ること");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (10, "カオリ（ハロウィン）", 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 0, "A", 7, 17, "高森奈津美", 53, 117701, 158, "自警団（カォン）", "いつでも「なんくるないさ～」な天然娘", "獣人族", "踊り、空手");
