INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (14, "スズナ（ハロウィン）", 4, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 0, "O", 10, 17, "上坂すみれ", 48, 117901, 167, "ルーセント学院", "天真爛漫で人気者のカリスマモデル", "魔族", "ファッション");
