INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (13, "アンナ（パイレーツ）", 7, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 0, "A", 5, 17, "髙野麻美", 45, 121901, 159, "トワイライトキャラバン", "前世を信じる中二病患者、「疾風の冥姫」", "魔族", "小説執筆");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (7, "シノブ（パイレーツ）", 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 0, "AB", 22, 18, "大坪由佳", 42, 122001, 157, "悪魔偽王国軍（ディアボロス）", "占いが得意な霊能少女", "魔族", "占い");
