INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (12, "ユカリ（キャンプ）", 3, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 0, "A", 16, 22, "今井麻美", 55, 122201, 164, "メルクリウス財団", "純情でほっとけない大人の女性", "エルフ", "ウインドーショッピング");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES ("", "ヴァンピィ", 12, "", 0, "AB", 6, "??", "釘宮理恵", 41, 122301, 149, "？？？", "けんぞくのご主人様", "魔族", "お散歩、お料理");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (2, "ヒヨリ（サマー）", 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 0, "A", 27, 16, "東山奈央", 44, 122401, 155, "トゥインクルウィッシュ", "人助けが大好き！　前向き格闘娘", "獣人族", "人助け、応援");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (2, "レイ（サマー）", 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 0, "B", 12, 18, "早見沙織", 46, 122501, 163, "トゥインクルウィッシュ", "クールで何事にも真っ直ぐな剣士", "魔族", "読書、乗馬、お茶");
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (2, "ユイ（サマー）", 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 0, "O", 5, 17, "種田梨沙", 47, 122601, 158, "トゥインクルウィッシュ", "戦闘のサポートが得意な、心優しい少女", "ヒューマン", "料理、人間観察");
