INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (5, "ミソギ（サマー）", 8, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 0, "O", 10, 9, "諸星すみれ", 27, 122801, 128, "リトルリリカル", "探検好きのイタズラっ子", "ヒューマン", "いたずら、探検");
